import React from 'react'
import { BrowserRouter as Router, Routes, 
  Route} from "react-router-dom";
  import { NavLink } from "react-router-dom";
import Home from "../App"
import Upload from "../uploading/client/src/uploading" 
//navs the name of each different list item
//gonna be a home page and a help page
//Need to add props for the nav tittles
function Navbar({navs}) {
  return (
 
 <section className="App">
 <Router>
   <nav>
     <NavLink to="/">Home</NavLink>
     <NavLink to="../uploading/client/src/uploading.js">About us</NavLink>
   </nav>
   <Routes>
     <Route exact path="/">
       <Home />
     </Route>
     <Route path="../uploading/client/src/uploading.js">
       <Upload />
     </Route>
   </Routes>
 </Router>
</section>

      
        )
}

export default Navbar
